import React from 'react';
import './styles/Header.css';
import Logo from './styles/Images/Logo.png'; // Adjust the path to your logo image

const Header = ({ setActiveSection }) => {
  return (
    <header className="header">
      <div className="logo">
      <button onClick={() => setActiveSection('home')} className="logoButton">
          <img src={Logo} alt="Logo" />
        </button>
      </div>
      <nav className="navLinks">
        
        <button onClick={() => setActiveSection('design')}>Design</button>
        <button onClick={() => setActiveSection('theory')}>Theory</button>
        <button onClick={() => setActiveSection('about')}>About</button>
      </nav>
    </header>
  );
};

export default Header;
